INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 2, "フリーマーケット会場", "青空の下で謁見", "ペコリーヌとの出会い", 1, 10118, 91002, 7, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 8, 40, 5118061);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 2, "フリーマーケット会場", "未来の騎空団\nマスコット？", "マホとの出会い", 1, 10118, 91002, 7, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 8, 40, 5118062);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 2, "ランドソル市街地", "お嬢さまからの\n緊急依頼", "アキノとの出会い", 1, 10118, 91002, 7, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 8, 40, 5118063);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 2, "フリーマーケット会場", "黄金色の悩みごと", "ジュンとの出会い", 1, 10118, 91002, 18, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 8, 40, 5118064);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 2, "フリーマーケット会場", "白熱！　格闘大会！", "カオリとの出会い", 1, 10118, 91002, 18, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 8, 40, 5118065);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 2, "オーエド町", "祭り太鼓はオーエドの華", "ニノンとの出会い", 1, 10118, 91002, 16, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 8, 40, 5118066);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 3, "フリーマーケット会場", "人気者は遅れて\nやってくる", "スズナとの出会い", 1, 10118, 91002, 19, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 8, 40, 5118067);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 3, "ランドソル市街地", "巫女・ミーツ・魔法少女", "ナナカとの出会い", 1, 10118, 91002, 18, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 8, 40, 5118068);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 3, "フリーマーケット会場", "ネズ耳は二度なくなる", "キャル＆コッコロとの出会い", 1, 10118, 91002, 18, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 8, 40, 5118069);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 3, "ランドソル市街地", "この出会いにカンパイ！", "ユカリとの出会い", 1, 10118, 91002, 18, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 8, 40, 5118070);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 3, "ランドソル市街地", "陰陽アンサンブル", "アオイとの出会い", 1, 10118, 91002, 18, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 8, 40, 5118071);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 3, "フリーマーケット会場", "運試し十番勝負！", "シノブとの出会い", 1, 10118, 91002, 7, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 8, 40, 5118072);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (20063115, 1, 0, "彼女たちの新たな日常", "オープニング", 0, 10118, 0, 0, 0, 0, 0, 0, 0, 5118600);
